"use strict";(self.webpackChunkwebsite=self.webpackChunkwebsite||[]).push([[1477],{10:e=>{e.exports=JSON.parse('{"blogPosts":[{"id":"ipixel01","metadata":{"permalink":"/blog/ipixel01","editUrl":"https://www.youtube.com/watch?v=dQw4w9WgXcQ&pp=ygUXbmV2ZXIgZ29ubmEgZ2l2ZSB5b3UgdXA%3D/blog/2023-08-01-blog.md","source":"@site/blog/2023-08-01-blog.md","title":"Indirecta Pixel Event & more","description":"\u2699\ufe0f Hello again Indirecta enthusiasts!","date":"2023-08-01T00:00:00.000Z","formattedDate":"August 1, 2023","tags":[{"label":"development","permalink":"/blog/tags/development"},{"label":"partners","permalink":"/blog/tags/partners"},{"label":"accessories","permalink":"/blog/tags/accessories"},{"label":"pcsi","permalink":"/blog/tags/pcsi"},{"label":"icomm","permalink":"/blog/tags/icomm"}],"readingTime":1.585,"hasTruncateMarker":false,"authors":[{"name":"lollodev5123","title":"Indirecta Management","url":"https://github.com/LolloDev5123","image_url":"https://avatars.githubusercontent.com/u/26120324?v=4","imageURL":"https://avatars.githubusercontent.com/u/26120324?v=4"}],"frontMatter":{"slug":"ipixel01","title":"Indirecta Pixel Event & more","authors":{"name":"lollodev5123","title":"Indirecta Management","url":"https://github.com/LolloDev5123","image_url":"https://avatars.githubusercontent.com/u/26120324?v=4","imageURL":"https://avatars.githubusercontent.com/u/26120324?v=4"},"tags":["development","partners","accessories","pcsi","icomm"]},"nextItem":{"title":"July Devlog","permalink":"/blog/icomm15"}},"content":"<img alt=\\"\\" src=\\"/img/sneakpeeks/indirecta_showcase.png\\" height=\\"300px\\"/>\\n\\n### \u2699\ufe0f Hello again Indirecta enthusiasts!\\n\\nThis is our second \\"blog\\"! We hope you\'re going to like this new stuff :)\\n\\n## \ud83d\ude4c First Indirecta Pixel Event\\n\\nAfter working a while on OCF, Pointcove\'s amazing estabilishment, we\'ve decided to start hosting little update events for our members and enthusiasts alike, we\'ve already hosted the first one!\\nWe demoed pCsi, although we\'ve had a few issues, and showed the amazing iComm install at OCF!\\n\\n<img alt=\\"\\" src=\\"/img/sneakpeeks/1st_pixel_event.png\\" height=\\"50px\\"/>\\n<img alt=\\"\\" src=\\"/img/sneakpeeks/icomm_cradles_diag.png\\" height=\\"50px\\"/>\\n\\n\\n## \ud83c\udf32 iComm Forest Demo Release\\n\\nFollowing the event, we\'ve decided to refurbish our old iFROTG (Indirecta Free Range Open Testing Grounds) game to use as a public demo for the latest iComm revisions, wanna try it out?\\n- https://www.roblox.com/games/12778761931/iComm-Forest-Demo\\n<img alt=\\"\\" src=\\"/img/sneakpeeks/icomm_demo.png\\" height=\\"50px\\"/>\\n\\n## \ud83d\udcbb pCsi Cubicle Demo Release\\n\\nJust after this, we didn\'t stop and released our second demo game for pCsi, our joint project with Pointcove to bring a somewhat realistic UNIX Terminal to Xinu!\\n- https://www.roblox.com/games/12778761931/iComm-Forest-Demo\\n<img alt=\\"\\" src=\\"/img/sneakpeeks/pcsi_demo.png\\" height=\\"50px\\"/>\\n<img alt=\\"\\" src=\\"/img/sneakpeeks/pcsi_demo_diag.png\\" height=\\"50px\\"/>\\n\\n## \ud83e\udd8e Indirecta Products Channel\\n\\nConfused by the documentation page layout? Eager to have a refined list of all the things we\'ve released? You\'ll be able to find this in our Discord, under the main category  \\n*and yes, we\'ve also released KiChain*\\n- https://discord.gg/xz4Xm8URcF\\n<img alt=\\"\\" src=\\"/img/sneakpeeks/products-channel.png\\" height=\\"50px\\"/>\\n\\n## \ud83e\uddbe pCsi Accessories by PIXI\\n\\nWe\'ve created pCsi with Pointcove to spread our love for free open source devices & products. This is one of the reasons this beautiful creation by one of our members came to be.  \\nCheck out this beautiful Xinu server by PIXI Group, you\'ll see them on our partner wall!\\n<img alt=\\"\\" src=\\"/img/sneakpeeks/2U-front.png\\" height=\\"50px\\"/>\\n<img alt=\\"\\" src=\\"/img/sneakpeeks/2U-retro.png\\" height=\\"50px\\"/>\\n\\n## \ud83e\udd1d NetPox Partnership\\n\\nWe\'ve partnered with NetPox! You may know them for their fantastic NetTec fire alarm system! You\'ll also find them on our homepage.\\n\\n## \u2697\ufe0f [We\'re still looking for testers!](/docs/beta-testers)"},{"id":"icomm15","metadata":{"permalink":"/blog/icomm15","editUrl":"https://www.youtube.com/watch?v=dQw4w9WgXcQ&pp=ygUXbmV2ZXIgZ29ubmEgZ2l2ZSB5b3UgdXA%3D/blog/2023-07-18-devlog.md","source":"@site/blog/2023-07-18-devlog.md","title":"July Devlog","description":"\u2699\ufe0f Hello Indirecta enthusiasts!","date":"2023-07-18T00:00:00.000Z","formattedDate":"July 18, 2023","tags":[{"label":"development","permalink":"/blog/tags/development"},{"label":"icomm","permalink":"/blog/tags/icomm"}],"readingTime":1.31,"hasTruncateMarker":false,"authors":[{"name":"lollodev5123","title":"Indirecta Management","url":"https://github.com/LolloDev5123","image_url":"https://avatars.githubusercontent.com/u/26120324?v=4","imageURL":"https://avatars.githubusercontent.com/u/26120324?v=4"}],"frontMatter":{"slug":"icomm15","title":"July Devlog","authors":{"name":"lollodev5123","title":"Indirecta Management","url":"https://github.com/LolloDev5123","image_url":"https://avatars.githubusercontent.com/u/26120324?v=4","imageURL":"https://avatars.githubusercontent.com/u/26120324?v=4"},"tags":["development","icomm"]},"prevItem":{"title":"Indirecta Pixel Event & more","permalink":"/blog/ipixel01"}},"content":"<img alt=\\"\\" src=\\"/img/indirecta_logo_medium500_withPill.png\\" height=\\"300px\\"/>\\n\\n### \u2699\ufe0f Hello Indirecta enthusiasts!\\n\\nThis is our attempt to transfer important news to our community in a different way :)\\n\\n## \ud83c\udf10 Website Domain Change\\n\\nThanks to our wonderful pal at [Car Parking Level 7](https://discord.gg/parking), *galacticinspired*, we\'ve been able to switch website domain to a sleeker\\n\\n### \ud83e\udd41.. [indirecta.tech](https://indirecta.tech) \ud83c\udf86\\n\\nYou\'ll now be spending a lot less time navigating to our website, or perhaps sharing it \ud83d\ude0e\\n\\n## \ud83c\udf99\ufe0f iComm 1.5 Beta Release\\n\\n- \u2b55 New [circle apps](/docs/FOSD/iComm/applications#circle-apps): Record Firewall & Walkie Talkie, an alternative to the traditional firewall remote and a simpler way to communicate\\n- \ud83d\uddfa\ufe0f D-Pad movement & optimizations come to the Map application! Switch modes using the left function key `LFN`\\n- \ud83d\udef0\ufe0f Radiocomm now supports Roblox\'s new `TextChatService` along with SOS & editable frequency textbox\\n- \ud83d\udd27 Tool Model changes to support for the upcoming cradle, and flashlight fixes\\n\\n## \ud83e\uddd1\u200d\ud83d\udcbb iComm+ Installation Service\\n\\nIntroducing iComm+! A paid install service that allows for custom devices, apps, and accessories running on the iComm firmware you know and love.\\nThis is still experimental, prices are guaranteed to change and there are no refunds.\\n\\n## \ud83e\udd1d Our awesome partnership with Scada\\n\\nYes, we\'ve partnered with Scada! You make know them as the group behind the Ae Expanse, SmartDMX, or Hanover.\\nWe recommend checking them out if you aren\'t already in their server, and trying out their products.\\nWho knows what cool stuff could come out in the future?\\nCheck all of our partners on the main home page!\\n  \\n## \u2697\ufe0f [We\'re still looking for testers!](/docs/beta-testers)"}]}')}}]);